CREATE TABLE candidates(
   cand_id            INTEGER  NOT NULL PRIMARY KEY 
  ,constituency_id    VARCHAR(9) NOT NULL
  ,party_name         VARCHAR(200) NOT NULL
  ,party_abbreviation VARCHAR(200) NOT NULL
  ,firstname          VARCHAR(200) NOT NULL
  ,surname            VARCHAR(200) NOT NULL
  ,gender             VARCHAR(200) NOT NULL
  ,sitting_mp         VARCHAR(1) NOT NULL
  ,former_mp          VARCHAR(1) NOT NULL
  ,votes              INTEGER  NOT NULL
  ,share              DECIMAL(11,9) NOT NULL
  ,movement           DECIMAL(11,9)
);
